import React from 'react';



function About () {
    return (
        <div>


        <h2>testing about section</h2>
        <p>Bee Better Massage is owned & operated by me, Alora! - Bachelor's Degree in Exercise Physiology- LMT (Licensed Massage Therapist)- CSCS (Certified Strength and Conditioning Specialist)- EMT (Emergency Medical Tech) - Concurrent continuing education for FRC (Functional Range Conditioning) My massage practice is focused on helping you "bee" a better version of yourself! In all reality, my goal is to help my clients fix their bodies by manually releasing muscle tension, improving joint function, strengthening to address posture & balance, and educating for lifelong improvements. My clients will become familiar with the joint & muscle structures within their own body as we massage, stretch, strengthen, and train. All of this will create an opportunity for the body to heal & for the client to be in control. My rental space is a part of the Yugen Wellness Center in Millcreek, UT.</p>
        </div>
    )
}


export default About;
